import React from 'react'
import CartIcon from '../Cart/CartIcon'
const HeaderCartButton = () => {
  return (
    <div><button>
        <span><CartIcon/></span>
        <span>Your Cart</span>
        <span>3</span>
        </button></div>
  )
}

export default HeaderCartButton
